import React, { useState, useEffect } from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Nav from './Nav/Nav';
import Homepage from './components/homepage/homepage';
import Login from './components/login/login';
import Register from './components/register/register';
import DocRegister from './components/register/docRegister';
import DoctorDashboard from './components/doctors/DoctorDashboard';
import DoctorList from './components/doctors/DoctorList';
import Booking from './components/booking';
import Appointments from './components/appointments/Appointments';
import ConversationList from './components/Chat/ConversationMessages'; // New component to display conversation list
import MessageList from './components/Chat/ConversationMessages'; // New component to display messages for a conversation
import { io } from 'socket.io-client'; // Import Socket.io client

import './App.css';

function App() {
  const [user, setLoginUser] = useState({});
  const [loading, setLoading] = useState(true);
  const [socket, setSocket] = useState(null); // State to store Socket.io instance

  useEffect(() => {
    const storedUser = localStorage.getItem('user');

    if (storedUser) {
      try {
        const parsedUser = JSON.parse(storedUser);
        setLoginUser(parsedUser);
      } catch (error) {
        console.error('Error parsing user data from localStorage:', error);
        localStorage.removeItem('user'); // Remove invalid data from localStorage
        setLoginUser({}); // Set an empty user object
      }
    }

    setLoading(false);
  }, []);

  useEffect(() => {
    // Connect to the WebSocket server
    const newSocket = io('http://localhost:3000');
    setSocket(newSocket);

    return () => {
      // Disconnect from the WebSocket server when component unmounts
      newSocket.disconnect();
    };
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    setLoginUser({});
  };

  if (loading) {
    return <p>Loading...</p>;
  }

  return (
    <div className="App">
      <Nav user={user} setLoginUser={setLoginUser} handleLogout={handleLogout} />
      <Routes>
        <Route path="/" element={<Homepage user={user} setLoginUser={setLoginUser} />} />
        <Route path="/login" element={<Login setLoginUser={setLoginUser} />} />
        <Route path="/register" element={<Register />} />
        <Route path="/register/doctor" element={<DocRegister />} />
        <Route path="/doctors" element={user._id ? (<DoctorList />) : (<Navigate to="/login" />)} />
        <Route path="/doctor-dashboard" element={user._id && user.isDoctor ? (<DoctorDashboard />) : (<Navigate to="/login" />)} />
        <Route path="/book-appointment/:doctorId" element={user._id ? (<Booking user={user} />) : (<Navigate to="/login" />)} />
        <Route path="/appointments" element={user._id ? (<Appointments user={user} />) : (<Navigate to="/login" />)} />
        {/* Routes for chat */}
        <Route path="/conversations" element={user._id ? (<ConversationList user={user} socket={socket} />) : (<Navigate to="/login" />)} />
        <Route path="/conversation/:conversationId" element={user._id ? (<MessageList user={user} socket={socket} />) : (<Navigate to="/login" />)} />
      </Routes>
    </div>
  );
}

export default App;
